import React from 'react';

function Menu() {
  return (
  <nav>
    <h1>Epic Cards Shop</h1>
    <ul>
      <li>Home</li>
      <li>Carrinho</li>
      <li>Sobre</li>
    </ul>
  </nav>
  );
}

export default Menu;
